import { Component } from "react";
import images from "./images";
class List extends Component{
    render(){
        return (
            <div>
                <images />
                <ol>
                    <li>1. <images linkgmabar='http://s3-ap-southeast-1.amazonaws.com/niomic/img/sample/food1.jpg' /> </li>
                    <li>2. <images linkgmabar='http://s3-ap-southeast-1.amazonaws.com/niomic/img/sample/ang.jpg' /></li>
                    <li></li>
                </ol>
            </div>
        )
    };
} export default List;
